const Persons = ({ persons, filtered }) => {
  const filteredPersons = persons.filter(person => person.name.toLowerCase().includes(filtered))
  
  return (
    <div>
      {filteredPersons.map(person => {
        <div key={person.name}>
        </div>
      })}
    </div>
  )
}

export default Persons
